import React from 'react';
import { TextField, Button, Checkbox, FormControlLabel, Box } from '@mui/material';

function CustomSignInForm({ onSubmit }) {
  const handleSubmit = (event) => {
    event.preventDefault();
    const formData = new FormData(event.currentTarget);
    onSubmit(formData);
  };

  return (
    <Box 
      component="form" 
      onSubmit={handleSubmit} 
      noValidate 
      sx={{ 
        display: 'flex', 
        flexDirection: 'column', 
        alignItems: 'center',
        gap: 2 
      }}
    >
      <TextField
        size="small"
        sx={{ width: '250px' }}
        required
        id="email"
        label="Email"
        name="email"
        autoComplete="email"
        autoFocus
      />
      <TextField
        size="small"
        sx={{ width: '250px' }}
        required
        id="FirstName"
        label="PrÃ©nom"
        name="FirstName"
      />
      <TextField
        size="small"
        sx={{ width: '250px' }}
        required
        id="LastName"
        label="Nom"
        name="LastName"
      />
      <TextField
        size="small"
        sx={{ width: '250px' }}
        required
        name="password"
        label="Mot de passe"
        type="password"
        id="password"
        autoComplete="current-password"
      />
      <FormControlLabel
        control={<Checkbox value="remember" color="primary" />}
        label="Se souvenir de moi"
      />
      <Button
        type="submit"
        variant="contained"
        sx={{ width: '250px' }}
      >
        Connexion
      </Button>
    </Box>
  );
}

export default function CustomSignInPage() {
  const handleSubmit = (formData) => {
    alert(
      `Connexion avec : ${formData.get('email')}, ${formData.get('FirstName')}, ${formData.get('LastName')}`
    );
  };

  return <CustomSignInForm onSubmit={handleSubmit} />;
}
